import React from 'react'
import { Link } from 'react-router-dom';
import './style/Homes.css';
// import IO from '../images/home/2.jpg';

class Homes extends React.Component {
    render() {
        return (
            <div className="Homes">
                <div className="Homes_container">
                    <h1>Elenco de personajes</h1>
                    <div className="Homes_ima">
                        
                      {/* <img src={IO} width="500px" height="500px" /> */}
                    </div>
                    <Link to="/badges">
                        <h3> Ver</h3>
                    </Link>
                </div>
            </div>
        )
    }
};

export default Homes;
